import pink from '../pink.jpg'

const Striscia = () => {

    return(
        <div className="w-full h-28 relative border">
             <div class="overlay absolute inset-0 bg-gray-800 opacity-50"></div>
            <img className='w-full h-28' src={pink} />
        </div>
    )
}

export default Striscia;
